in_source: |-
  int a = 1;
  int b = 1;
  int sum = 0;
  int temp;

  while (b < 4000000){
      if(b % 2 == 0){
          sum = sum + b;
      }

      temp = b;
      b = a + b;
      a = temp;
  }
  print("Сумма всех четных чисел Фибоначчи, которые меньше 4.000.000 = ");
  print(sum);

